==Trivia==
*Da Vinci is a reference to the real-life painter and inventor, {{Wp|Leonardo da Vinci}}.
*Da Vinci appears to be holding a unique form of a paintbrush which is unobtainable, likely only intended for this NPC.
*Da Vinci's hair is a different colour when speaking to him in the [[Dancing Donkey Inn]].

